#include<bits/stdc++.h>
using namespace std;
void printArr(vector<int> &nums){
    for(int i = 0; i < nums.size(); i++){
        cout << nums[i] << " ";
    }
}
int findMaxConsecutiveOnes(vector<int>& nums) {
        int sz = nums.size();
        cout<<sz<<endl;
        if(sz==0)
            return 0;
        if(sz==1 && nums[0]==1)
            return 1;
        vector<int> cnt_zero ;
        for(int i =0;i<sz;i++){
            if(nums[i]==0){
                cnt_zero.push_back(i);
            }
        }
        printArr(cnt_zero);

        if(cnt_zero.size()==0){
            return sz;
        }
        int max = cnt_zero[0];
        cout<<max<<endl;
        if(cnt_zero.size()==1){
            int diff = sz - 1 - max;
            if(diff>max){
                max = diff;
            }
        }
        for(int i =1;i<cnt_zero.size();i++){
                int diff = cnt_zero[i] - cnt_zero[i-1] - 1;
                if(max<diff){
                    max = diff;
                }
        }
        if(sz - cnt_zero[cnt_zero.size()-1]-1 > max){
            max= sz - cnt_zero[cnt_zero.size()-1]-1;
        }

        // printArr(cnt_zero);

        return max;
}

